funcMain:
  function funcMain() {
    const tag = localStorage.getItem("TZ_MAIN");
    if (tag && new Date().getTime() - tag < 1000 * 5) return;
    localStorage.setItem("TZ_MAIN", new Date().getTime());

    location.href = "https://castlepine.co.kr/_mobile/GolfRes/onepage/real_reservation.asp";
  }

funcReserve:
  function funcReserve() {
    log("funcReserve");
    
    if (!suffix) return;

    const suffixParam = (() => {
      const result = {};
      suffix.split("&").forEach((item) => {
        const dv = item.split("=");
        result[dv[0]] = dv[1];
      });
      return result;
    })();

    log("settype", suffixParam["settype"]);
    if (suffixParam["settype"] == "T") {
      log("calendar");
      funcDate();
    } else if (suffixParam["settype"] == "R") {
      log("time");
      funcTime();
    } else {
      return;
    }
  }

funcDate:
  function funcDate() {

    const tag = localStorage.getItem("TZ_LOGOUT");
    if (tag && new Date().getTime() - tag < 1000 * 5) {
      funcEnd();
      return;
    }
    localStorage.setItem("TZ_LOGOUT", new Date().getTime());

    TZLOG(logParam, (data) => {
      const daySign = (new Date([year, month, date].join("/")).getDay() + 1).toString();
      timefrom_change(fulldate, "2", daySign, "", "00", "T");
    });
  }

funcTime:
function funcTime() {
  log("timeresbtn_" + dictCourse[course] + "_" + time);
  const target = window["timeresbtn_" + dictCourse[course] + "_" + time];
  log("target", target);
  if (target) {
    target.click();
    funcExec();
  } else {
    funcEnd();
  }
}

funcEnd:
function funcEnd() {
  log("funcEnd");
  const strEnd = "end of reserve/reserve";
  logParam.message = strEnd;
  TZLOG(logParam, (data) => {});
  const ac = window.AndroidController;
  if (ac) ac.message(strEnd);
  location.href = "/_mobile/login/logout.asp";
}
